import React from "react";
import { Row, Col, PageContent } from "antd";


function maquinas() {
    return (
   <>
        <Row gutter={[32, 32]}>
      <Col span={24}>
        <PageContent
          title="Maquinas"
          breadcrumb={[
            {
              title: "Pages",
            },
            {
              title: "Maquinas",
            }
          ]}
        />
      </Col>
    </Row>
   </>
    );
}

export default maquinas
